    super ()
    this.state = {
      input:'',
    }
  }

  onInputChange = (event) => {
    console.log (event); 
  }


  render () {
  return (
    <div className="App">
        <Particles className='particles'
              params={particlesOptions}
            />
      <Navigation />
      <Logo />
      <Rank/> 
      <ImageLinkForm onInputChange={onInputChange}/>
      {/*<Logo />
      <ImageLinkForm />
      <FaceRecognition />*/}
    </div>
  );
}
}

export default App;
